import React from 'react';
import { Loader } from '@googlemaps/js-api-loader';

const loader = new Loader({
  apiKey: 'AIzaSyCWgR18p7RsKbfVhNuYB7B2FJYWIG-2xRE',
  version: 'weekly',
  libraries: ['geometry', 'drawing', 'places'],
});

const LoadScript = ({ children }) => {
  const [, setLoadError] = React.useState(null);

  React.useEffect(() => {
    const loadMap = async () => {
      try {
        await loader.load();
      } catch (e) {
        setLoadError(e);
      }
    };

    loadMap();
  }, []);

  if (loader.maps) {
    return <>{children}</>;
  } else {
    return <div>Loading...</div>;
  }
};

export default LoadScript;
